import React from 'react';
import CollectionOverview from '../../components/collectionsOverview/collectionsOverview';
import { Route,Redirect } from 'react-router-dom';
import CategoryPage from '../collection/collection';

const ShopPage = (props) => {
	console.log('match', props.match);
	return (
		<div>
			<Route exact path={`${props.match.path}`} component={CollectionOverview}>
				<Route path={`${props.match.path}/:collectionId`} component={CategoryPage} />
                <Redirect to={`${props.match.path}`}/>
			</Route>
		</div>
	);
};

export default ShopPage;
